#!/bin/bash 
#$ -S /bin/sh
#$ -N test
#$ -j y
#$ -o .
#$ -e .
#$ -cwd
#$ -q all.q
#$ -masterq all.q@node9
#$ -pe thread 8-8
source ~/.bashrc
hash -r
export GMXBINPATH=/XXX/bin:GMXBINPATH

echo "#----------------------------------------------------------------#"
echo "Step 1: Prepare GROMACS input configure and topology file."
echo "#----------------------------------------------------------------#"
cd mobley_1017962
dos2unix *.sh *.in *.inp
mkdir ff
mkdir em
mkdir nvte
mkdir npte
mkdir nptpd
mkdir anneal
cp GaussianAntechamber.sh mobley_1017962.mol2 leap.in acpype.py *.inp ff
cd ff
chmod 700 GaussianAntechamber.sh
nohup ./GaussianAntechamber.sh &
wait
mv TST_GMX.top mobley_1017962.top
cp mobley_1017962_pack.pdb mobley_1017962.top ../em
cd ../
 
echo "#----------------------------------------------------------------#"
echo "Step 2: Energy equlibrium"
echo "#----------------------------------------------------------------#"
cd em
gmx grompp -f ../../emequilibrium.mdp -c mobley_1017962_pack.pdb -p mobley_1017962.top 			-o emequilibrium.tpr -maxwarn 2
gmx mdrun -nt 8 -v -deffnm emequilibrium
wait 
cp emequilibrium.gro mobley_1017962.top ../nvte
cd ../
 
echo "#----------------------------------------------------------------#"
echo "Step 3: NVT equlibrium"
echo "#----------------------------------------------------------------#"
cd nvte
gmx grompp -f ../../nvtequilibrium.mdp -c emequilibrium.gro -p mobley_1017962.top			-o nvtequilibrium.tpr -maxwarn 2
gmx mdrun -nt 8 -v -deffnm nvtequilibrium
wait 
cp nvtequilibrium.gro mobley_1017962.top ../npte 
cd ../
 
echo "#----------------------------------------------------------------#"
echo "Step 4: NPT equlibrium"
echo "#----------------------------------------------------------------#"
cd npte
gmx grompp -f ../../nptequilibrium.mdp -c nvtequilibrium.gro -p mobley_1017962.top			-o nptequilibrium.tpr -maxwarn 2
gmx mdrun -nt 8 -v -deffnm nptequilibrium
wait 
cp nptequilibrium.gro mobley_1017962.top ../anneal 
cp nptequilibrium.gro mobley_1017962.top ../nptpd 
cd ../

echo "#----------------------------------------------------------------#"
echo "Step 5: NPT Producation run"
echo "#----------------------------------------------------------------#"
cd nptpd
gmx grompp -f ../../nptpd.mdp -c nptequilibrium.gro -p mobley_1017962.top 			-o nptpd.tpr -maxwarn 2
gmx mdrun -nt 8 -v -deffnm nptpd
wait 
cd ../

echo "#----------------------------------------------------------------#"
echo "Step 6: Annealing Simulation"
echo "#----------------------------------------------------------------#"
cd anneal
gmx grompp -f ../../anneal.mdp -c nptequilibrium.gro -p mobley_1017962.top			-o anneal.tpr -maxwarn 2 
gmx mdrun -nt 8 -v -deffnm anneal 
wait 
cd ../

cd ../
 
