cd mobley_2143011
dos2unix *.sh *.in *.inp
mkdir ff
mkdir em
mkdir nvte
mkdir npte
mkdir nptpd
mkdir anneal
cp GaussianAntechamber.sh mobley_2143011.mol2 leap.in acpype.py *.inp ff
cd ff
chmod 700 GaussianAntechamber.sh
nohup ./GaussianAntechamber.sh &
wait
mv TST_GMX.top mobley_2143011.top
cp mobley_2143011_pack.pdb mobley_2143011.top ../em
cd ../
 
echo "#----------------------------------------------------------------#"
echo "Step 2: Energy equlibrium"
echo "#----------------------------------------------------------------#"
cd em
gmx grompp -f ../../emequilibrium.mdp -c mobley_2143011_pack.pdb -p mobley_2143011.top 			-o emequilibrium.tpr -maxwarn 2
gmx mdrun -nt 8 -v -deffnm emequilibrium
wait 
cp emequilibrium.gro mobley_2143011.top ../nvte
cd ../
 
echo "#----------------------------------------------------------------#"
echo "Step 3: NVT equlibrium"
echo "#----------------------------------------------------------------#"
