gmx mdrun -nt 8 -v -deffnm nvtequilibrium
wait 
cp nvtequilibrium.gro mobley_2143011.top ../npte 
cd ../
 
echo "#----------------------------------------------------------------#"
echo "Step 4: NPT equlibrium"
echo "#----------------------------------------------------------------#"
cd npte
gmx grompp -f ../../nptequilibrium.mdp -c nvtequilibrium.gro -p mobley_2143011.top			-o nptequilibrium.tpr -maxwarn 2
gmx mdrun -nt 8 -v -deffnm nptequilibrium
